LOI N° 61/019 DU 27 NOVEMBRE 1981 AUTORISANT LE PRÉSIDENT DE LA RÉPUBLIQUE À RATIFIER L'ACCORD COMMERCIAL SIGNÉ LE 16 JANVIER 1981 À YAOUNDÉ ENTRE LE GOUVERNEMENT DE LA RÉPUBLIQUE POPULAIRE DÉMOCRATIQUE DE CORÉE ET LE GOUVERNEMENT DE LA RÉPUBLIQUE UNIE DU CAMEROUN.

L'ASSEMBLEE NATIONALE A DELIBERE ET ADOPTE ;
LE PRESIDENT DE LA REPUBLIQUE PROMULGUE LA LOI DONT LA TENEUR SUIT :
